    false,nt"url": null,nt"notes": "NCEI Accession 0155954 includes physical
    and underway data collected aboard the MELVILLE during cruise MGLN32MV in the Philippine
    Sea, South China Sea (Nan Hai) and Sulu Sea from 2008-02-07 to 2008-02-28. These
    data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Craig Lee of University of Washington; Applied Physics
    Laboratory, and by University of California - San Diego; Scripps Institution of
    Oceanography as part of High-resolution Towed Body Surveys of Submesoscale Variability
    in the Philippine Archipelago. The Lamont-Doherty Earth Observatory (LDEO) submitted
    these data to NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R)
    program.nnThe ADCP data represent the raw and automated processed data set. Post
    processed quality assessed data are not available in this accession.",nt"license_title":
